function largeOffsetter(daohashes: number, singlexoffset: number, doublexoffset: number, triplexoffset: number, whalexoffset: number, yoffset: number): coordinates[] {

  const xdimension = 260;
  const ydimension = 350;

  let x1 = (xdimension/2);
  let x2 = (xdimension/2);
  let x3 = (xdimension/2);

  let y1 = (2 * ydimension/5) - yoffset;

  let y21 = (2 * ydimension/5 - ydimension/12) - yoffset;
  let y22 = (2 * ydimension/5 + ydimension/12) - yoffset;

  let y31 = (2 * ydimension/5 - ydimension/6 + ydimension/36) - yoffset;
  let y32 = (2 * ydimension/5 + ydimension/36) - yoffset;
  let y33 = (2 * ydimension/5 + ydimension/6 + ydimension/36) - yoffset;

  let position0 = {x: x1, y: y1} as coordinates;
  let position1 = {x: x2, y: y1} as coordinates;
  let position2 = {x: x3, y: y1} as coordinates;

  if (daohashes == 1) {
    x1 = x1 - singlexoffset;

    position0 = {x: x1, y: y1} as coordinates;
  }
  if (daohashes == 2) {
    x1 = x1 - doublexoffset;

    position0 = {x: x1, y: y1} as coordinates;
  }
  if (daohashes == 3) {
    x1 = x1 - triplexoffset;

    position0 = {x: x1, y: y1} as coordinates;
  }
  if (daohashes == 4) {
    x1 = x1 - doublexoffset;
    x2 = x2 - doublexoffset;

    position0 = {x: x1, y: y21} as coordinates;
    position1 = {x: x2, y: y22} as coordinates;
  }
  if (daohashes == 5) {
    x1 = x1 - triplexoffset;
    x2 = x2 - doublexoffset;

    position0 = {x: x1, y: y21} as coordinates;
    position1 = {x: x2, y: y22} as coordinates;
  }
  if (daohashes == 6) {
    x1 = x1 - triplexoffset;
    x2 = x2 - triplexoffset;

    position0 = {x: x1, y: y21} as coordinates;
    position1 = {x: x2, y: y22} as coordinates;
  }
  if (daohashes == 7) {
    x1 = x1 - triplexoffset;
    x2 = x2 - singlexoffset;
    x3 = x3 - triplexoffset;

    position0 = {x: x1, y: y31} as coordinates;
    position1 = {x: x2, y: y32} as coordinates;
    position2 = {x: x3, y: y33} as coordinates;
  }
  if (daohashes == 8) {
    x1 = x1 - triplexoffset;
    x2 = x2 - doublexoffset;
    x3 = x3 - triplexoffset;

    position0 = {x: x1, y: y31} as coordinates;
    position1 = {x: x2, y: y32} as coordinates;
    position2 = {x: x3, y: y33} as coordinates;
  }
  if (daohashes == 9) {
    x1 = x1 - triplexoffset;
    x2 = x2 - triplexoffset;
    x3 = x3 - triplexoffset;

    position0 = {x: x1, y: y31} as coordinates;
    position1 = {x: x2, y: y32} as coordinates;
    position2 = {x: x3, y: y33} as coordinates;
  }
  if (daohashes > 9) {
    x1 = x1 - whalexoffset;

    position0 = {x: x1, y: y1} as coordinates;
  }

  return [position0, position1, position2];
}

